import React from 'react';
import FoodItem from './FoodItem';

const FoodList = ({ foods, fetchFoods }) => {
  return (
    <div>
      {foods.map((food) => (
        <div key={food._id}>
          <FoodItem food={food} fetchFoods={fetchFoods} />
          <button onClick={() => handleUpdate(food._id)}>Update</button>
        </div>
      ))}
    </div>
  );

  function handleUpdate(foodId) {
    // Implement your update logic here
    console.log("Update button clicked for food with ID:", foodId);
    // You can use this function to trigger the update action for the specific food item
  }
};

export default FoodList;
